  -o-transition: all 0.6s ease;
}

#MobileAdInGameEnd-Box,
#MobileAdInGameEnd2-Box,
#MobileAdInGameEnd3-Box {
  z-index: 10000;
  position: absolute;
  width: 302px;
  height: 250px;
}

#MobileAdInGameEnd-Box-Body,
#MobileAdInGameEnd2-Box-Body,
#MobileAdInGameEnd3-Box-Body {
  z-index: 10000;
  position: relative;
  background: transparent;
}

#MobileAdInGameEnd-Box-Footer,
#MobileAdInGameEnd2-Box-Footer,
#MobileAdInGameEnd3-Box-Footer {
  z-index: 10000;
  position: relative;
  font-size: 11px;
  height: 20px;
  color: #fff;
  background: transparent;
}

#MobileAdInGameEnd-Box-Header,
#MobileAdInGameEnd2-Box-Header,
#MobileAdInGameEnd3-Box-Header {
  z-index: 10000;
  position: relative;
  margin-top: -2px;
  font-size: 11px;
  height: 20px;
  text-align: right;
  color: #fff;
  background: transparent;
}

#MobileAdInGameEnd-Box-Close,
#MobileAdInGameEnd2-Box-Close,
#MobileAdInGameEnd3-Box-Close {
  position: absolute;
  z-index: 10005;
  background-image: url('media/graphics/generic-ad/light/close-button.png');
  background-repeat: no-repeat;
  width: 22px;
  height: 22px;
  top: -4px;
  margin-right: -1px;
  display: none;
}

.ig_debug {
  position: fixed;
  left: 0;
  bottom: 0;
  width: 100%;
  background-color: #000;
  border-top: 2px solid #f57401;
  font-size: 12px;
  color: #fff;
  z-index: 1000;
  -webkit-user-select: none;
  display: none;
}

.ig_debug_panel_menu {
  height: 28px;
  background: #222;
  background: -webkit-gradient(linear, left bottom, left top, color-stop(0, #000000), color-stop(1, #333));
  background: -moz-linear-gradient(center bottom, #000000 0%, #333 100%);
  background: -o-linear-gradient(#333, #000000);
}

.ig_debug_panel_menu div {
  float: left;
  height: 22px;
  padding: 6px 8px 0 8px;
  border-right: 1px solid #333;
}

.ig_debug_panel_menu .ig_debug_head {
  font-weight: bold;
  color: #888;
}

.ig_debug_menu_item:hover {
  cursor: pointer;
  background-color: #fff;
  color: #000;
}

.ig_debug_menu_item.active,
.ig_debug_menu_item.active:hover {
  background-color: #000;
  color: #fff;
}

.ig_debug_stats {
  position: absolute;
  right: 0;
  top: 0;
  float: right;
  color: #888;
  border-left: 1px solid #333;
  text-align: right;
}

.ig_debug_stats span {
  width: 3em;
  display: inline-block;
  color: #fff !important;
  margin-right: 0.2em;
  margin-left: 0.3em;
  font-family: bitstream vera sans mono, courier new;
  white-space: nowrap;
}

.ig_debug_panel {
  height: 152px;
  overflow: auto;
  position: relative;
}

.ig_debug_panel canvas {
  border-bottom: 1px solid #444;
}

.ig_debug_panel .ig_debug_panel {
  padding: 8px;
  height: auto;
  float: left;
  background-color: #000;
  border-right: 2px solid #222;
}

.ig_debug_option {
  padding: 2px 0 2px 8px;
  cursor: pointer;
}

.ig_debug_option:first-child {
  margin-top: 8px;
}

.ig_debug_option:hover {
  background-color: #111;
}

.ig_debug_graph_mark {
  position: absolute;
  color: #888;
  left: 4px;
  font-size: 10px;
  margin-top: -12px;
}

.ig_debug_legend {
  color: #ccc;
}

.ig_debug_label_mark {
  display: inline-block;
  width: 10px;
  height: 10px;
  margin-right: 4px;
  -webkit-transition: 0.1s linear;
  -moz-transition: 0.1s linear;
}

.ig_debug_legend_color {
  display: inline-block;
  width: 6px;
  height: 10px;
  margin-right: 4px;
  margin-left: 16px;
}

.ig_debug_legend_number {
  width: 3em;
  display: inline-block;
  text-align: right;
  font-family: bitstream vera sans mono, courier new;
  color: #fff;
  margin-right: 0.2em;
}

.ig_debug_map_container {
  position: relative;
  overflow: hidden;
  border: 1px solid #888;
}

.ig_debug_map_container canvas {
  position: absolute;
}

.ig_debug_map_screen {
  position: absolute;
  border: 1px solid #f0f;
}</style>

async function unzipWebpFromDataUri(dataUri) {
    const blobUrls = {};

   
    const base64 = dataUri.split(',')[1];
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }

    //Load the zip
    const zip = await JSZip.loadAsync(bytes);


    for (const [filename, file] of Object.entries(zip.files)) {
    if (!file.dir) {
        let mime = '';

        if (filename.endsWith('.js') || filename.endsWith('.mjs')) {
            mime = 'text/javascript';
        } else if (filename.endsWith('.css')) {
            mime = 'text/css';
        } else if (filename.endsWith('.html')) {
            mime = 'text/html';
        } else if (filename.endsWith('.webp')) {
            mime = 'image/webp';
        } else if (filename.endsWith('.png')) {
            mime = 'image/png';
        } else if (filename.endsWith('.jpg') || filename.endsWith('.jpeg')) {
            mime = 'image/jpeg';
        }
      

        const rawBlob = await file.async("blob");
        const blob = mime ? new Blob([rawBlob], { type: mime }) : rawBlob;

        const blobUrl = URL.createObjectURL(blob);
        console.log(filename);
        blobUrls[filename] = blobUrl;
    }
}

    
    return blobUrls;
